n// @stylint on\\n\\n// Default Font-size\\n$basefont ?= 16px\\n\\nrem($value, $base = $basefont)\\n    $max = length($value)\\n\\n    $remValues = ()\\n    for $i in (0...$max)\\n        push($remValues, _convert-to-rem($value[$i], $base))\\n\\n    return $remValues\\n\\n_convert-to-rem($px, $base)\\n    if (typeof($px) == 'unit')\\n        if ((unit($px) == '' || unit($px) == 'px') && ($px != 0))\\n            return (round($px / $base, 3))rem\\n        else\\n            return 0\\n\\n/*\\n    rem($value, $basefont)\\n\\n    rem() takes one or more numeric values in pixel and calculates the rem values from it.\\n\\n    NB: you don't have to explicitly write the `px` unit.\\n\\n    $value - The value in pixel you want to translate in rem. For multiple values you can use `rem(14 12)` for shorthand properties such as `margin`.  Multiples values should be separated by spaces.\\n    $basefont - If you need to overwrite the default `$basefont` value of `16`\\n\\n    Weight: 1\\n\\n    Styleguide Tools.mixins.rem\\n*/\\n\\n/*\\n    hide()\\n\\n    hide() mixin definitely hides an element. This mixin doesn't take parameters.\\n\\n    Weight: 2\\n\\n    Styleguide Tools.mixins.hide\\n*/\\nhide()\\n    display     none !important  // @stylint ignore\\n    visibility  hidden !important  // @stylint ignore\\n\\n/*\\n    visually-hide()\\n\\n    visually-hide() mixin visually hides an element. The element is still visible by screen readers.\\n    This mixin doesn't take parameters.\\n\\n    Weight: 3\\n\\n    Styleguide Tools.mixins.visually-hide\\n*/\\nvisually-hide()\\n    border 0\\n    clip rect(0 0 0 0)\\n    clip-path polygon(0 0, 0 0, 0 0)\\n    height 1px\\n    margin -1px\\n    overflow hidden\\n    padding 0\\n    position absolute\\n    width 1px\\n    white-space nowrap\\n\\n/*\\n    reset()\\n\\n    reset() mixin removes every padding, margin and border of an element.\\n    This mixin doesn't take parameters.\\n\\n    Weight: 4\\n\\n    Styleguide Tools.mixins.reset\\n*/\\nreset()\\n    margin  0\\n    padding 0\\n    border  0\\n\\nglobal(selector, placeholder, type = extend)\\n    if type == extend\\n        if cssmodules == true\\n            :global({selector})\\n                @extend {placeholder} // @stylint ignore\\n        else\\n            {selector}\\n                @extend {placeholder} // @stylint ignore\\n    else if type == mixin\\n        if cssmodules == true\\n            :global({selector})\\n                {placeholder}() // @stylint ignore\\n        else\\n            {selector}\\n                {placeholder}() // @stylint ignore\\n\\ncssModulesUtils(props, breakpoints)\\n    for kBp, vBp in breakpoints\\n        if vBp == ''\\n            for kProp, vProp in props\\n                :global(.u-{vProp})\\n                    {kProp}()\\n        else\\n            @media (max-width: rem(lookup('BP-'+kBp)))\\n                for kProp, vProp in props\\n                    :global(.u-{vProp}-{vBp})  // @stylint ignore\\n                        {kProp}()\\n\\nnativeUtils(props, breakpoints)\\n    for kBp, vBp in breakpoints\\n        if vBp == ''\\n            for kProp, vProp in props\\n                .u-{vProp}\\n                    {kProp}()\\n        else\\n            @media (max-width: rem(lookup('BP-'+kBp)))\\n                for kProp, vProp in props\\n                    .u-{vProp}-{vBp}  // @stylint ignore\\n                        {kProp}()\\n\\n// @stylint on\\n\",\"@require '../tools/mixins'\\n\\n/*------------------------------------*\\\\\\n  Breakpoints\\n  =====\\n\\\\*------------------------------------*/\\n\\n// variables\\n\\nBP-teeny       =  375\\nBP-tiny        =  480\\nBP-small       =  768\\nBP-medium      = 1023\\nBP-large       = 1200\\nBP-extra-large = 1439\\n\\n// Standard breakpoints collection for utilities\\nbreakpoints = {\\n    'none': '',\\n    'tiny': 't',\\n    'small': 's',\\n    'medium': 'm',\\n}\\n\\n/*\\n    Breakpoints\\n\\n    This is the collection of available breakpoint variables:<br><br>\\n    - `BP-teeny`         -  375px\\n    - `BP-tiny`          -  480px\\n    - `BP-small`         -  768px\\n    - `BP-medium`        -  1023px\\n    - `BP-large`         -  1200px\\n    - `BP-extra-large`   -  1439px\\n\\n    <br>Also we have a standard breakpoints collection meant to be used as suffixes for some utility classes<br>\\n\\n    If you want a utility class to trigger only at defined breakpoints you can use those:<br><br>\\n    - `-t`  - refers to `tiny` breakpoint (max-width: 480px)\\n    - `-s`  - refers to `small` breakpoint (max-width: 768px)\\n    - `-m`  - refers to `medium` breakpoint (max-width: 1023px)\\n\\n    Styleguide Settings.breakpoints\\n*/\\n\\n/*\\n    Media Queries mixins\\n\\n    You can use these mixins with no arguments and they will output\\n    the desired a `max-width` media-query. Use the direction argument\\n    to set it to `min`.\\n\\n    Styleguide Settings.breakpoints.mixins\\n*/\\n\\n// mixins\\n// @stylint off\\nsize-helper(direction, size)\\n    direction == 'min' ? size + 1 : size\\n\\n/*\\n    teeny-screen()\\n\\n    teeny-screen() Refers to (max-width: 375px)\\n    teeny-screen('min') Refers to (min-width: 376px)\\n\\n    Weight: -6\\n\\n    Styleguide Settings.breakpoints.mixins.teeny\\n*/\\nteeny-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-teeny)))\\n        {block}\\n\\n/*\\n    tiny-screen()\\n\\n    tiny-screen() Refers to (max-width: 480px)\\n    tiny-screen('min') Refers to (min-width: 481px)\\n\\n    Weight: -5\\n\\n    Styleguide Settings.breakpoints.mixins.tiny\\n*/\\ntiny-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-tiny)))\\n        {block}\\n\\n/*\\n    small-screen()\\n\\n    small-screen() Refers to (max-width: 768px)\\n    small-screen('min') Refers to (min-width: 769px)\\n\\n    Weight: -4\\n\\n    Styleguide Settings.breakpoints.mixins.small\\n*/\\nsmall-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-small)))\\n        {block}\\n\\n/*\\n    medium-screen()\\n\\n    medium-screen() Refers to (max-width: 1023px)\\n    medium-screen('min') Refers to (min-width: 1024px)\\n\\n    Weight: -3\\n\\n    Styleguide Settings.breakpoints.mixins.medium\\n*/\\nmedium-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-medium)))\\n        {block}\\n\\n/*\\n    large-screen()\\n\\n    large-screen() Refers to (max-width: 1200px)\\n    large-screen('min') Refers to (min-width: 1201px)\\n\\n    Weight: -2\\n\\n    Styleguide Settings.breakpoints.mixins.large\\n*/\\nlarge-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-large)))\\n        {block}\\n\\n/*\\n    extra-large-screen()\\n\\n    extra-large-screen() Refers to (max-width: 1439px)\\n    extra-large-screen('min') Refers to (min-width: 1440px)\\n\\n    Weight: -1\\n\\n    Styleguide Settings.breakpoints.mixins.extra-large\\n*/\\nextra-large-screen(direction='max')\\n    @media ({direction}-width: rem(size-helper(direction, BP-extra-large)))\\n        {block}\\n\\n// mixins named\\n\\n/*\\n    small-device()\\n\\n    Refers to (max-width: 543px), (max-height: 375px)\\n    Triggers when the viewport has a width smaller than 543px OR a height smaller than 375px\\n\\n    Weight: 0\\n\\n    Styleguide Settings.breakpoints.mixins.small-device\\n*/\\n\\nsmall-device()\\n    @media (max-width: rem(size-helper('max', BP-tiny))), (max-height: rem(size-helper('max', BP-teeny)))\\n        {block}\\n\\n/*\\n    medium-device()\\n\\n    Refers to (min-width: 543px) and (min-height: 375px)\\n    Triggers when the viewport has a width bigger than 543px AND a height bigger than 375px\\n\\n    Weight: 0\\n\\n    Styleguide Settings.breakpoints.mixins.medium-device\\n*/\\n\\nmedium-device()\\n    @media (min-width: rem(size-helper('min', BP-tiny))) and (min-height: rem(size-helper('min', BP-teeny)))\\n        {block}\\n\\n/*\\n    desktop()\\n\\n    Refers to (min-width: 1024px)\\n\\n    Weight: 0\\n\\n    Styleguide Settings.breakpoints.mixins.desktop\\n*/\\ndesktop()\\n    @media (min-width: rem(size-helper('min', BP-medium)))\\n        {block}\\n\\n/*\\n    tablet()\\n\\n    Refers to (min-width: 769px) and (max-width: 1023px)\\n\\n    Weight: 1\\n\\n    Styleguide Settings.breakpoints.mixins.tablet\\n*/\\ntablet()\\n    @media (min-width: rem(size-helper('min', BP-small))) and (max-width: rem(size-helper('max', BP-medium)))\\n        {block}\\n\\n/*\\n    mobile()\\n\\n    Refers to small-screen() which is (max-width: 768px)\\n\\n    Weight: 2\\n\\n    Styleguide Settings.breakpoints.mixins.mobile\\n*/\\nmobile()\\n    +small-screen()\\n        {block}\\n\\n/*\\n    gt-mobile()\\n\\n    Refers to (min-width: 769px)\\n\\n    Weight: 3\\n\\n    Styleguide Settings.breakpoints.mixins.gt-mobile\\n*/\\ngt-mobile()\\n    @media (min-width: rem(size-helper('min', BP-small)))\\n        {block}\\n\\n/*\\n    gt-tablet()\\n\\n    Refers to (min-width: 1024px)\\n\\n    Weight: 4\\n\\n    Styleguide Settings.breakpoints.mixins.gt-tablet\\n*/\\ngt-tablet()\\n    @media (min-width: rem(size-helper('min', BP-medium)))\\n        {block}\\n\\n/*\\n    lt-desktop()\\n\\n    Refers to medium-screen() which is (max-width: 1023px)\\n\\n    Weight: 5\\n\\n    Styleguide Settings.breakpoints.mixins.lt-desktop\\n*/\\nlt-desktop()\\n    +medium-screen()\\n        {block}\\n// @stylint on\\n\",\"@require '../tools/mixins'\\n@require './colors'\\n\\n/*------------------------------------*\\\\\\n  Text utilities\\n\\\\*------------------------------------*/\\n\\njson_colors=json('../settings/palette.json', { hash: true })\\n\\nfor color in utility_colors\\n    $color-{color}\\n        color: json_colors[color] !important // @stylint ignore\\n\\n    global('.u-' + color, '$color-' + color)\\n\\n\\n$breakword\\n    word-break break-word\\n\\n$ellipsis\\n    white-space nowrap\\n    overflow hidden\